import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.*;

public class Main {
    static class Liquid {
        String color;
        int density;

        public Liquid(String color, int density) {
            this.color = color;
            this.density = density;
        }
    }

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        int N = Integer.parseInt(br.readLine());
        List<Liquid> liquids = new ArrayList<>();
        for (int i = 0; i < N; i++) {
            String[] line = br.readLine().split(" ");
            liquids.add(new Liquid(line[0], Integer.parseInt(line[1])));
        }
        Collections.sort(liquids, Comparator.comparingInt(l -> l.density));

        int M = Integer.parseInt(br.readLine());
        List<String> drink = new ArrayList<>();
        for (int i = 0; i < M; i++) {
            drink.add(br.readLine());
        }

        Map<String, Integer> colorMap = new HashMap<>();
        for (int i = 0; i < N; i++) {
            colorMap.put(liquids.get(i).color, i);
        }

        int index = M - 1;
        boolean possible = true;
        while (index >= 0) {
            String color = drink.get(index);
            if (!colorMap.containsKey(color)) {
                possible = false;
                break;
            }
            int liquidIndex = colorMap.get(color);
            if (index > 0 && drink.get(index - 1).equals(color)) {
                if (liquids.get(liquidIndex).density >= liquids.get(liquidIndex + 1).density) {
                    possible = false;
                    break;
                }
            } else {
                if (index > 0 && drink.get(index - 1).equals(color)) {
                    index--;
                } else {
                    index--;
                }
            }
        }

        System.out.println(possible ? "Yes" : "No");
    }
}
